    true,nt"url": null,nt"notes": "The Gun-Free Schools Act Report, 2003-04
    (GFSA Report 2003-04), is a study that is part of the Gun-Free Schools Act Reports
    (GFSA Report) program; program data is available since 1997-98 at <http://www2.ed.gov/about/reports/annual/gfsa/index.html>.
    GFSA Report 2003-04 (http://www2.ed.gov/about/reports/annual/gfsa/index.html) is
    a universe survey that collects information on elementary- and secondary-student
    expulsions related to possession of a firearm at school. The study was conducted
    using paper instruments. Local education agencies (LEAs) and state education agencies
    (SEAs) receiving federal funds under the Elementary and Secondary Education Act
    (ESEA), as amended, were required to provide information. Key statistics produced
    from GFSA Report 2003-04 were information on the number of students expelled (by
    type of firearm and school level); the number of expulsions that were modified on
    a case-by-case basis; the number of modified cases that were not for students with
    disabilities; and the number of expelled students who were referred to an alternative
    school or program.",nt"owner_org": "8c0bc869-1189-4ced-af26-2abd2337b886",nt"extras":
